INSERT INTO `project` VALUES (1, 1, NULL, '恒兴御景园', '', '恒兴御景园工程位于广东省深圳市宝安区锦程路和二一路交汇处东北角。\n项目用地面积25635.49平方米，拟建建筑总面积约147788.62平方米，建筑基地面积（一级/二级）81383.86/2902.8平方米，为高层建筑，建筑不分期，设计使用年限50年，建筑层数31层，建筑高度95.1米，建筑防火分类一类高层，耐火等级为一级，\n主要结构类型；塔楼为剪力墙、裙房及地下室为框架结构，抗震设防烈度为七度。主要建设内容包括：1#、2#多功能组合建筑，3#、5#、6#为高层住宅建筑、4#楼为多层幼儿园。', '113.785441', '22.712746', '{\"url\": \"//tszl-img.oss-cn-shenzhen.aliyuncs.com/pQe4fet1627233499321\", \"nwLat\": \"22.712898\", \"nwLng\": \"113.783701\", \"seLat\": \"22.711587\", \"seLng\": \"113.786887\"}', '{\"x\": 76, \"y\": 15, \"z\": -44, \"url\": \"//tszl-static.oss-cn-shenzhen.aliyuncs.com/gitf/xx.gltf\"}', '2021-11-17 00:00:00', '2021-12-14 00:00:00', 1.00, NULL, 0, NULL, NULL, NULL);
INSERT INTO `project` VALUES (2, 1, NULL, '深未大厦', '', '根据《中华人民共和国城乡规划法》第四十条的规定，现将佳兆业深未大厦（曾用名“兆方投资大楼城市更新单元”）项目的《建设工程规划许可证》及总平面图予以公告。', '113.980221', '22.551248', '{\"url\": \"//tszl-img.oss-cn-shenzhen.aliyuncs.com/7XBZAcf1637579682800\", \"nwLat\": \"22.551248\", \"nwLng\": \"113.980221\", \"seLat\": \"22.550029\", \"seLng\": \"113.981551\"}', 'null', '2021-12-22 00:00:00', '2022-01-19 00:00:00', 0.00, NULL, 0, NULL, NULL, NULL);
INSERT INTO `project` VALUES (3, 1, NULL, '宝慧金融中心项目', NULL, '本项目位于佛山市南海区大沥镇盐步广佛新干线与联河路交汇处地段，本项目总用地面积51369.4㎡，总建筑面积约44万平方米，计算容积率面积约26万㎡，其中办公约15万㎡，商业约5万㎡，政府服务行政中心约5万㎡；地下四层，地下车库面积约11万㎡，地下商业约1.7万㎡；地上由6栋塔楼及相关副楼组成，其中1座、2-1座、2-2座楼高21层，4座楼高25层，5座楼高25层，6座楼高22层。', '113.148659', '23.099299', '{\"url\": \"//tszl-img.oss-cn-shenzhen.aliyuncs.com/yzjFk7T1627435266531\", \"nwLat\": \"23.10106\", \"nwLng\": \"113.150242\", \"seLat\": \"23.094902\", \"seLng\": \"113.150242\"}', '{\"x\": 76, \"y\": 15, \"z\": -44, \"url\": \"//tszl-static.oss-cn-shenzhen.aliyuncs.com/gitf/bhjr.gltf\"}', '2021-12-29 10:10:26', '2021-12-29 10:10:30', 0.00, 1, 0, '2021-12-29 10:10:40', NULL, NULL);
